@import url("https://fonts.googleapis.com/css?family=Open+Sans");
body {
  font-size: 16px;
  color: #000000;
  line-height: 1.26;
}

h1 {
  color: #014054;
  font-size: 60px;
  margin: 0 10px;
}

h2 {
  color: #014054;
  font-size: 36px;
}

h3 {
  font-size: 24px;
  color: #FFF;
  padding: 15px 0;
}

h1,
h2 {
  margin: 20px 0;
  padding: 20px 0;
}

header {
  position: relative;
  display: block;
  min-height: 1240px;
  background: url("68c63ab2f6f7d6e39e29b84e80ad81d0.jpg") no-repeat no-repeat center center;
  background-size: auto 100%;
}
header .nav-link {
  color: #FFF !important;
}
header .m10-brand-logo {
  max-width: 250px;
}
header .container {
  padding: 10px 10px 80px 10px;
}
header .header-message {
  text-align: center;
  padding: 10px;
  color: #FFF;
  font-size: 32px;
  font-weight: 900;
  line-height: normal;
  letter-spacing: 0.5px;
  text-align: left;
}

a {
  text-decoration: none;
  color: #014054;
}
a :hover {
  color: #ff5c7d;
}

img {
  width: 100%;
  height: auto;
  overflow: hidden;
}

.m10-jumbotron {
  background-color: #ffbbb5;
}

.m10-carousel {
  background-color: #014054;
  color: #FFF;
}
.m10-carousel h1,
.m10-carousel h2 {
  color: #ff5c7d;
}
.m10-carousel .m10-btn {
  color: #FFF;
}

.m10-btn {
  margin: 15px 0;
  background-color: transparent;
  border: 2px solid #ff5c7d;
}
.m10-btn :hover {
  background-color: #014054;
  color: #FFF;
}

.container {
  padding: 80px;
}

.m10-featured .container {
  padding: 40px;
}

.m10-featured-item {
  padding: 30px;
}

.m10-featured-image {
  padding: 0;
}

/* Small devices (landscape phones, 576px and up) */
@media (max-width: 576px) {
  .container {
    padding: 10px;
  }

  h1 {
    font-size: 24px;
    font-weight: 900;
    line-height: 1.26;
  }

  h2 {
    font-size: 18px;
    font-weight: 700;
  }

  h3 {
    font-size: 16px;
    font-weight: 500;
  }

  .m10-carousel {
    text-align: center;
    justify-content: center;
  }
  .m10-carousel .image {
    display: block;
    margin: 0 auto;
    max-width: 250px;
    align-self: center;
    justify-self: center;
  }
}
.m10-bottom-logo {
  max-width: 65px;
  max-height: 72px;
  margin: 0 auto;
  float: right;
}

/* Medium devices (tablets, 768px and up) The navbar toggle appears at this breakpoint */
@media (max-width: 768px) {
  .container {
    padding: 20px;
  }

  .m10-featured .m10-featured-image {
    margin: 0px -20px;
  }
  .m10-featured .m10-featured-item {
    padding: 20px;
  }

  .m10-bottom-logo {
    float: none;
  }

  header {
    min-height: 569px;
    background: url("68c63ab2f6f7d6e39e29b84e80ad81d0.jpg") no-repeat no-repeat right center;
    background-size: auto 100%;
  }
  header .nav-link {
    font-size: 16px;
  }
  header .m10-brand-logo {
    max-width: 192px;
  }
  header .header-message {
    font-size: 22px;
  }
}
